import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

export default function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route index element={<h3>Hello Index !!!</h3>} />
          <Route path="/table" element={<h1>Hello Table</h1>} />
        </Routes>
      </Router>
    </div>
  )
}
